//import './CartItem.css';

export default function CartItem({ name, cost, address, email }) {
  return (
    <div className="CartItem">
      <div>{name}</div>
      <div className="CartItem-details">
        <div>${cost.toFixed(2)}</div>
        <div>{email}</div>
        <div>{address}</div>
      </div>
    </div>
  );
}
